import { JSEncrypt } from 'encryptlong'

//加密方法
export function Encrypt(data) {
    const PUBLIC_KEY = ''
    let encryptor = new JSEncrypt()
    encryptor.setPublicKey(PUBLIC_KEY)
    const rsaData = encryptor.encryptLong(data)
    return rsaData
}
export default {
    Encrypt
}
